B.D1=new A.ot("assets/images/eduard1.jpg","Eduard Khan","Founder of ESTA, Tennis Coach","Eduard was born in Russia. Since the age of 8 his only passion in life is tennis. He is trying to pass this passion on to a new generation by creating a unique Tennis facility, where everyone can feel themselves excel.","","")
B.D3=new A.ot("assets/images/david.jpg","David Barragan","Tennis Director","David Barragan has been the Director of the ESTA Tennis Academy since 2017. He is Colombian and speaks fluent Spanish, English and German. David started playing tennis when he was five years old and competed in junior tournaments","all over the east coast since he was seven. His highest ranking was #9 in the North Carolina Junior Boys\u2019 18\u2019s division. During his four years as #1 on the East Mecklenburg High School tennis team in Charlotte, North Carolina, David was voted Most Valuable Player, was Team Captain and All-Conference. He was awarded the North Carolina High School Athletic Association State Participation Award in 2003, 2004 and 2005.","USPTA Certified Professional Tennis Instructor, CPR&AED Certified")
B.D0=new A.ot("assets/images/ellie (2).jpg","Ellie Burningham","Tennis Coach","Ellie Burningham became part of our ESTA family since September 2022. She first discovered her love for tennis when she was 11 years old and has been playing ever since.","She started competing at Ridge Community High School on their varsity team, and has many accomplishments, including qualifying to compete at the state championship during her junior year. After graduation, she was offered an athletic scholarship to be a part of the Warner University tennis team where she competed at the highest level. Since Coach Ellie started her teaching career with us, her goal has been to encourage our students to find thier love for tennis. She strives to help them become the best athletes they can be.","")
B.D4=new A.ot("assets/images/mavlon.jpg","Mavlonbek Kuchkarov","Tennis Coach","Coach Mavlon was born in Tashkent, Uzbekistan. Tennis has always been his passion since he started this sport at 6 years old. He has achieved great results as a junior player at National tournaments and","participated in many ITF tournaments. Once he received his Bachelor\u2019s degree at Uzbekistan State University of physical education and sports, he decided to become a world-class tennis coach. He is pursuing this dream every day. Coach Mavlon has worked with many students of pro level around the world. Today, he is dedicated to grow world-class tennis players at ESTA Tennis Academy.","Certified as a Tennis Coach by International Tennis Federation (ITF)\nCertified by PTR \u201cProfessional Tennis Registry\u201d has complete all requirements for PTR Certification 11 to 17 Performance.\nJacques Rogge- President of the Olympic Committee certifies that Mr. Mavlonbek Kuchkarov has taken part in the Olympic Solidarity \u201cTechnical Course for Coaches in tennis (Level-2) held from June 19 to 29, 2012 in Tashkent under the auspices of the National Olympic of Uzbekistan.\nCertified of attendance Mr. Mavlonbek Kuchkarov in ITF Asian Regional Coaches Conference which held from 7-10 November 2012 Bangkok, Thailand.")
B.D2=new A.ot("assets/images/alex1.jpg","Alex Ananchenkov","Fitness Coach","Coach Alex was born in Saint Petersburg, Russia. He has moved to Florida at age 16. Coach Alex always had a passion for Sports since childhood. Alex has achieved Bachelor\u2019s Degree in Sport & Exercises science from UCF.","His background in sports is 4 years of Track & Field and 9 years of weightlifting and fitness. He also practices Brazilain Jiu Jitsu and currently holds a purple belt. Alex\u2019s coaching philosophy is based on quality rather than quantity. \u201cMaster the basics and you will achieve greatness.","Spectrum Sports Performance (400 hours), NASM Kids, CPR")
